import FavoriteLogo from '../assets/star.svg';
import FullFavoriteLogo from '../assets/full-star.svg';
import { FavoriteStarContainer } from './FavoriteStar.style';

export function FavoriteStar({isFavorite, onClick}){
    return(
        <FavoriteStarContainer>
            {isFavorite ?
                <img src={FullFavoriteLogo} onClick={onClick} className='selected'/>
                :<img src={FavoriteLogo} onClick={onClick} />
            }
        </FavoriteStarContainer>
    )
}
